   "Provenance": "Provenance\n\nPunjab University, Chandigarh, India; Galerie 54, Paris\n\nCatalogue Essay\n\nDuring the Partition of India in 1947, Punjab lost Lahore, its capital, to Pakistan. In his haste to quit the heat, Border Commissions chair Sir Cyril Radcliffe had drawn a reckless line through towns, fields, even houses. In the Punjab alone, ten million Muslims, Hindus, and Sikhs were displaced. Radcliffe had never been to India before and only stayed five weeks.\n\nAddressing the urgent need for a Punjabi capital, Prime Minister Nehru commissioned the planning and construction of Chandigarh, a model city to be built in the foothills of the Himalayas. Named for the Hindu goddess Chandi (bearer of lotus and lightning), Chandigarh would function as the symbol of a progressive and auspicious Indian future.\n\nAmerican planner Albert Mayer and Polish architect Matthew Nowicki drafted the first drawings of the city, a rectangular grid of ‘superblocks’ intended to house 500,000 residents. Nowicki died in a plane crash in 1950, and Mayer withdrew from the project. In their stead, Le Corbusier and his cousin Pierre Jeanneret undertook the design and completion of the capital complex, including ‘sectors’ for housing, government offices, industry, and commerce. Jeanneret became chief architect after Le Corbusier’s own departure in 1959.\n\nAided by admiring Indian colleagues, Jeanneret built a series of residential and civic buildings including the dramatic Ghandi Bhawan, the library of Ghandian studies at Punjab University. Its canted roofs, like wings, expressed the lofty aspirations of the project. For Jeanneret, no detail was too small; he designed lampposts, manhole covers, paddle boats—everything. Out of necessity, and with respect for his surroundings, he employed local craftsmen to build with local materials.\n\nBefore the Second World War, Jeanneret was a steady presence in his cousin’s Paris atelier. His furniture for Chandigarh reflects the rational principles proclaimed by Le Corbusier decades earlier in Towards a New Architecture (1923). In the case of the present library table, load bearing is shifted from outer legs (which impede the legs) to internal pilotis; the projecting top extends beyond the supports, giving the impression of lightness despite its massive size.A long strip of glass, like a ribbon window, unifies the composition while ensuring privacy.\n\nUnlike Sir Radcliffe’s recess, Jeanneret’s fifteen year stay in India was a lifetime. Architectural critic Patwant Singh wrote: “His solutions were not impatient impositions.” Jeanneret helped build by hand what Radcliffe’s arbitrary sweep could not: a modern India. When Jeanneret returned to Europe in 1965, ill and unable to work, he reportedly lamented, “I am leaving my home and going to a foreign country.” His ashes, returned to Chandigarh, were scattered on Lake Sukhna.",
