   "Auction Name": "Design: Living in a Material World",
   "Item Title": "ILLUMINATED READING TABLE, MODEL NO. PJ-TAT-10-B, DESIGNED FOR THE ASSEMBLY AND THE UNIVERSITY LIBRARY, CHANDIGARH, INDIA",
   "Item Height (cm)": "111.5",
   "Item Width (cm)": "244.3",
   "Item Depth (cm)": "122",
   "Item Description": "Overall good condition consistent with age and use. Scattered scuff marks, scratches and staining throughout. Watermarks to the top surface concentrated to both sides. A few deeper scratches to the top, the longest approximately 50 cm. Two areas with minor lifting to the veneer, the longest approximately 30 cm. An area fading to the middle part of the top surface approximately 30cm in diameter. An area of veneer to one of the corners of the surface has been replaced at some point, measuring approximately 21 x 10 cm. A mild curve to the top surface as visible in the printed and online catalogue. The bases of the legs with scattered scuffs and scratches throughout with chips and water stains concentrated to the top and bottom. An area of deeper scratches to one of the legs, approximately 15 cm in length. Two small areas of veneer have been replaced. Oxidation to the metal supports and shades throughout. Minor paint loss to the interior of both shades. The glass panel and electrical components are later replacements.Sotheby's does not guarantee electrical components and suggests having all wiring inspected by a licensed electrician.",
   "Provenance": "PROVENANCE\nChandigarh, India\nArtcurial Paris, 24 November, 2010, lot 218\nAcquired from the above by the present owner\nLITERATURE\nEric Touchaleaume and Gerald Moreau, Le Corbusier, Pierre Jeanneret, The Indian Adventure: Design-Art-Architecture, Paris, 2010, pp. 368, 370-72, 580\nGalerie Patrick Seguin, ed., Le Corbusier, Pierre Jeanneret: Chandigarh, India, Paris, 2014, pp. 173, 217-23, 286\nCATALOGUE NOTE\nMentored by his cousin Charles Edouard Jeanneret – better known as Le Corbusier – Pierre Jeanneret was the more hands-on and slightly overshadowed architect of the pair, whose project for the design of the city of Chandigarh in India remains one of the most significant and iconic Modernist architectural designs. Collaborating for well over 20 years with Le Corbusier, he worked on developing the furniture and interiors in which the designs were iterated for use by residents and city officials alike. Pierre Jeanneret stayed in Chandigarh after its completion, appointed Head Architect by the Administration of the city.\nWorking with the simplicity and strength of raw materials, Pierre Jeanneret produced a range of furniture that not only accessorised and accompanied the people and their activities in the city but also grew to encapsulate the myth of the Chandigarh utopia.",
