   "Item Description": "Overall color and condition good, light natural wear to surfaces and extremities commensurate with age and use. There are occasional water ring marks to the top. There are various small areas of old infill to the legs, particularly along the bases just above where they connect to the ground. The surfaces of the legs have been very lightly cleaned and applied with a light varnish. The top laminate may have been replaced, however not recently. The top laminate appears to have been made from a form of Indian teak with feint dark striations to the grain. The underside of the top has oxidation and dark age-related patination. The areas beneath the top where the legs connect to the underside are paler in color/less oxidized and patinated. The underside of the legs where they connect to the ground display wear commensurate with age and consistent use. The surfaces of the top have been re-varnished, but this does not appear to have been done recently, there is age deterioration to the varnish. Overall in our opinion the table presents well, and retains a firm structure. Further photographs of the table may be supplied on request.",
