   "Provenance": "CATALOGUE NOTE\nThe Pigeonhole Desk was designed during the famous Chandigarh project in India for the Secretariat and various administrative buildings in Chandigarh, India. When India gained independence in 1947, Nehru decided to commission a contemporary architect for the creation of the new capital of the Punjab region, which would become Chandigarh. Le Corbusier's project was designed to illustrate the bright future of the new country. The commission also included the creation of all the furniture for administrative buildings and housing. For the design of the furniture, Le Corbusier chose Pierre Jeanneret, his cousin and lifelong collaborator. Both of these architects-designers' styles remained eminently modern, while respectful of Indian savoir-faire and craftsmanship. ",
