   "Provenance": "Provenance\n\nPierre Jeanneret, Chandigarh.\nPresent of Pierre Jeanneret to a friend and collaborator, 1965.\n\nThe present piece comes from a small series of experimental chairs, all slightly different from one another, which Pierre Jeanneret made for his own personal use. Jeanneret worked with the local Indian materials, which were new to him, to create novel forms for these pieces. The present chair, with its simple materials, is a testament to Jeanneret's pioneering spirit. Hélène Bauchet-Cauquil says about Jeanneret: \"Another part of his activity was the creation of pieces of furniture using rough lumber, bamboo, plaited straw, rope, webbing, cereal baskets, concrete framework, objects that even the poorest could afford. These objects were turned into chairs, tables, lamps and beds that furnished his house and constituted models that were accessible to everyone.\"\n(Architectures en Inde, Paris, 1986, p. 109)\n\nThe present chair is one of very few that were made and it is the only one of this model that has been found to this date. A very similar armchair is in the collection of the City Museum of Chandigarh.\n\nJ. Sagar, City Museum - Chandigarh, Chandigarh, 2001, p. 50 for a similar model.\n\nS. and S. Bahga, Le Corbusier and Pierre Jeanneret: Footprints on the Sands of Indian Architecture, New Delhi, 2000, p. 35 for similar models with cord seats and backs.\n\nJ. Lucan, ed., Le Corbusier une encyclopédie, exhibition catalogue, Centre Georges Pompidou, Paris, p. 214 for a similar model with a cord seat and back.\n\nExhibition catalogue, Architectures en Inde, ENSBA, Paris, 1986, pp. 109-110 for a similar model with a cord seat.\n\n\"Chandigarh,\" Marg, no. 1, December, 1961, p. 31 for similar models with cord seats and backs.",
